import React from "react";
import{ReactComponent as  Logo} from "../../assets/crown.svg";
import { Link } from "react-router-dom";

const Header = () => {
  return <div className="header">
      <Link to='/' className='logo-container'>
      <Logo/>
      </Link>
  </div>;
};
export default Header;
